import PropTypes from "prop-types";

function Card({ image }, { titlebio }, { bio = "Default bio" }) {
    if(!image && titlebio && bio){
        console.log("the elements has been required");
    }

    return <div className="card">
        <img src={image} alt="Poplloon Project" />
        <div className="card-body">
            <h4 className="card-title">{titlebio}</h4>
            <p className="card-bio bio-secundary">{bio}</p>
        </div>
    </div>
}

Card.propTypes = {
    image: PropTypes.string.isRequired,
    titlebio: PropTypes.string,
    bio: PropTypes.string
}

export default Card;
